function App() {
  return (
    <div className="container">
      <Header />
      <Section />
    </div>
  );
}

function Header() {
  return (
    <header>
      <img src="./avatar-jessica.jpeg" alt="Jessica's Avatar" />
      <p className="profile--name">Jessica Randall</p>
      <p className="profile--address">London, United Kingdom</p>
      <p className="profile--title">"Front-end developer and avid reader."</p>
    </header>
  );
}

function Section() {
  return (
    <section>
      <Links profileLink={"https://github.com/nayera540"}>GitHub</Links>
      <Links profileLink={"https://www.frontendmentor.io/profile/nayera540"}>
        Frontend Mentor
      </Links>
      <Links
        profileLink={"https://www.linkedin.com/in/nayera-hazem-72b1451b3/"}
      >
        LinkedIn
      </Links>
      <Links profileLink={"https://x.com/nanzoo26"}>Twitter</Links>
      <Links profileLink={"https://www.instagram.com/"}>Instagram</Links>
    </section>
  );
}

function Links({ profileLink, children }) {
  return (
    <div className="container--links">
      <a className="profile--links" href={profileLink} target="_blank">
        {children}
      </a>
    </div>
  );
}

export default App;
